"Google fotoattēli izmanto atrašanās vietu, lai jums palīdzētu sakārtot un meklēt fotoattēlus.

 Informācija par atrašanās vietu var tiek iegūta no šādiem avotiem:
 • jūsu kameras GPS;
 • jūsu Google atrašanās vietu vēsture;
 • noteiktie orientieri."

"Atcerieties apmeklētās vietas, atklājot fotoattēlus, kuros ir iekļauta informācijas par atrašanās vietu, tostarp kopīgotos fotoattēlus, kurus esat saglabājis. Jūsu kartē tiek izmantota šāda atrašanās vietas informācija:

 • jūsu kameras GPS;
 • jūsu Google atrašanās vietu vēsture;
 • noteiktie orientieri."

"No jūsu ierīces tiks neatgriezeniski dzēsti šādi lietotnē Google fotoattēli glabāti dati: 

• bloķētajā mapē glabātie fotoattēli un videoklipi; 
• konti, kuros esat pierakstījies; 
• iestatījumi. 

Netiks dzēsti fotoattēli un videoklipi, kas netiek glabāti bloķētajā mapē, kā arī citi lietotņu dati."
